#define ROWS 160
#define COLS 160
#define DETECT_THRESHOLD 0.3

#define PREDICT_ROWS 32
#define PREDICT_COLS 160

float features[ROWS * COLS * 3];

typedef struct {
    int row_start;
    int row_end;
    int col_start;
    int col_end;
} ei_detect_box_t;


void floodFill(float arr[ROWS][COLS], int visited[ROWS][COLS], int i, int j, int *startRow, int *startCol, int *endRow, int *endCol) {
    if (i < 0 || i >= ROWS || j < 0 || j >= COLS || arr[i][j] != 1 || visited[i][j]) {
        return;
    }

    visited[i][j] = 1;

    if (i < *startRow) *startRow = i;
    if (j < *startCol) *startCol = j;
    if (i > *endRow) *endRow = i;
    if (j > *endCol) *endCol = j;

    // Visit all 4 neighboring cells (up, down, left, right)
    // floodFill(arr, visited, i - 1, j, startRow, startCol, endRow, endCol);
    // floodFill(arr, visited, i + 1, j, startRow, startCol, endRow, endCol);
    // floodFill(arr, visited, i, j - 1, startRow, startCol, endRow, endCol);
    // floodFill(arr, visited, i, j + 1, startRow, startCol, endRow, endCol);
}

void findAllBoxes(float arr[ROWS][COLS], std::vector<ei_detect_box_t> *boxes) {
    int visited[ROWS][COLS];
    memset(visited, 0, sizeof(visited));

    for (int i = 0; i < ROWS; i++) {
        for (int j = 0; j < COLS; j++) {
            if (arr[i][j] == 1 && !visited[i][j]) {
                int startRow = i, startCol = j, endRow = i, endCol = j;
                floodFill(arr, visited, i, j, &startRow, &startCol, &endRow, &endCol);

                ei_detect_box_t new_box;
                new_box.row_start = startRow;
                new_box.row_end = endRow;
                new_box.col_start = startCol;
                new_box.col_end = endCol;

                size_t area = (new_box.row_end - new_box.row_start) * (new_box.col_end - new_box.col_start);
                if (area < 10) continue;

                boxes->push_back(new_box);
            }
        }
    }
}

